description:
Thirteen-year-old James and his wacky, working-class family inherit a 3,250 year-old mummy who promptly comes to life, puts his spoiled, regal, ancient Egyptian feet up on the coffee table and proceeds to hog the remote. There's really nothing like a teenage Pharaoh in the house to fill the place with hijinks, crack an introverted boy out of his shell and give a new perspective to the sheer craziness of our overly technical, hyperactive, new millennial lives.

